import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import MainContent from './components/MainContent';
import './assets/css/blog.css';

function App() {
  return (
    <div className="App">
      <Header />
      <main className="container">
        <div className="row">
          <MainContent />
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default App;
